const ADD_PERSONAL = 'ADD_PERSONAL';
const ADD_PROFESSIONAL = 'ADD_PROFESSIONAL';

const actionPersonal = (state) => ({
  type: ADD_PERSONAL,
  payload: state,
});

const actionProfessional = (state) => ({
  type: ADD_PROFESSIONAL,
  payload: state,
});

export default { ADD_PROFESSIONAL, ADD_PERSONAL, actionPersonal, actionProfessional };
